package edubridge;

public class SwitchEx {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		char ch='z';
		switch (ch) {
		case 'a' : 
			System.out.println("Jay");
		break;
		case 'b' : 
			System.out.println("name");
		break;
		default:
			System.out.println("Mumbai");
		}
	}

}
